        private string ReadImagePathFromFile()
        {
            string imagePath = "";
            try
            {
                // افتح ملف النص لقراءة مسار الصورة
                string path = "imagePath.txt";
                if (File.Exists(path))
                {
                    using (StreamReader reader = new StreamReader(path))
                    {
                        imagePath = reader.ReadLine();
                    }
                }
            }
            catch (Exception ex)
            {
                MessageBox.Show("حدث خطأ أثناء قراءة مسار الصورة: " + ex.Message);
            }
            return imagePath;

        }


        private string ReadImagePathFromFile2()
        {
            string imagePath2 = "";
            try
            {
                // افتح ملف النص لقراءة مسار الصورة
                string path2 = "imagePath2.txt2";
                if (File.Exists(path2))
                {
                    using (StreamReader reader2 = new StreamReader(path2))
                    {
                        imagePath2 = reader2.ReadLine();
                    }
                }
            }
            catch (Exception ex2)
            {
                MessageBox.Show("حدث خطأ أثناء قراءة مسار الصورة: " + ex2.Message);
            }
            return imagePath2;
        }






