        private void SaveImagePathToFile(string imagePath)
        {
            try
            {
                // افتح ملف نصي لحفظ مسار الصورة
                string path = "imagePath.txt";
                using (StreamWriter writer = new StreamWriter(path))
                {
                    writer.WriteLine(imagePath);
                }
            }
            catch (Exception ex)
            {
                MessageBox.Show("حدث خطأ أثناء حفظ مسار الصورة: " + ex.Message);
            }
        }

