        private void printb120_Click(object sender, EventArgs e)
        {
            a120 += 0;
            b120 = a120;
            a120 = b120;



            PrintDocument printDoc = new PrintDocument();
            printDoc.PrintPage += (s, ev) =>
            {

                DateTime currentDate = DateTime.Today;
                int day = currentDate.Day;       // اليوم
                int month = currentDate.Month;   // الشهر
                int year = currentDate.Year;



                string textToPrint = "  " + a120;
                ev.Graphics.DrawString(textToPrint, new Font("Arial", 50), Brushes.Black, 350, 250);


                string tee = b1_20.Text + " / " + button20.Text;
                ev.Graphics.DrawString(tee, new Font("Arial", 22), Brushes.Black, 300, 200);

                string te = label1.Text;
                ev.Graphics.DrawString(te, new Font("Arial", 25), Brushes.Black, 300, 50);




                string tim = DateTime.Now.ToString("الوقت:" + "hh:mm:ss tt"); //time
                ev.Graphics.DrawString(tim, new Font("Arial", 16), Brushes.Black, 550, 400);

                string dat = "التاريخ :" + $"{day}/{month}/{year}";
                ev.Graphics.DrawString(dat, new Font("Arial", 16), Brushes.Black, 100, 400);

                string dad = "عدد المنتظرين=0";
                ev.Graphics.DrawString(dad, new Font("Arial", 14), Brushes.Black, 550, 360);



                Image imageToPrint = pictureBox1.Image;
                pictureBox1.SizeMode = PictureBoxSizeMode.Zoom;

                int desiredWidthInPixels = 150;
                int desiredHeightInPixels = 150;


                float aspectRatio = (float)imageToPrint.Width / imageToPrint.Height;
                int scaledWidth = desiredWidthInPixels;
                int scaledHeight = (int)(desiredWidthInPixels / aspectRatio);


                if (scaledHeight > desiredHeightInPixels)
                {
                    scaledHeight = desiredHeightInPixels;
                    scaledWidth = (int)(desiredHeightInPixels * aspectRatio);
                }

                PointF imagePosition = new PointF(120, 3);


                ev.Graphics.DrawImage(imageToPrint, imagePosition.X, imagePosition.Y, scaledWidth, scaledHeight);




                Image imageToPrint2 = pictureBox2.Image;
                pictureBox2.SizeMode = PictureBoxSizeMode.Zoom;

                int desiredWidthInPixels2 = 150;
                int desiredHeightInPixels2 = 150;

                // حساب نسبة التحجيم للحفاظ على نسب الأبعاد
                float aspectRatio2 = (float)imageToPrint2.Width / imageToPrint2.Height;
                int scaledWidth2 = desiredWidthInPixels2;
                int scaledHeight2 = (int)(desiredWidthInPixels2 / aspectRatio2);


                if (scaledHeight2 > desiredHeightInPixels)
                {
                    scaledHeight2 = desiredHeightInPixels2;
                    scaledWidth2 = (int)(desiredHeightInPixels2 * aspectRatio2);
                }

                PointF imagePosition2 = new PointF(600, 3);


                ev.Graphics.DrawImage(imageToPrint2, imagePosition2.X, imagePosition2.Y, scaledWidth2, scaledHeight2);


                ev.HasMorePages = false;











            };

            ///PrintDialog printDialog = new PrintDialog();
           // printDialog.Document = printDoc;
            printDoc.PrintController = new StandardPrintController();
            printDoc.Print();


        }



